import React, { Component } from "react";

class Contact extends Component {
  render() {
    return (
      <div>
        <h2>Justin Haney</h2>
        <ul>
          <li>Email: Jahaney@west.com</li>
          <li>Phone: 251-447-9323</li>
        </ul>
      </div>
    );
  }
}

export default Contact;
